import React from 'react'
import {Wrapper, Title} from '../Styled'
import styled from 'styled-components'

const CardContainer = styled(Wrapper)`
    width: 100%;
    display:flex;
    flex-direction:row;
`

const ValueCard = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    height:20em;
    width:15em;
    border: 10px solid var(--s-3);
` 

export default function Values() {
    return (
        <Wrapper>
            <Title>Values</Title>
            <CardContainer>
                <ValueCard>
                    minimal
                </ValueCard>
                <ValueCard>
                    mobile first 
                </ValueCard>
                <ValueCard>
                    component based
                </ValueCard>
            </CardContainer>
        </Wrapper>
    )
}
